import React from 'react';
import Fragment from 'react'

function todoList() {
    return (
        <Fragment>
            <div>
                todo list
            </div>
            <div>
                <input />
                <button>add</button>
            </div>
            <ul>
                <li>study chinese</li>
                <li>study english</li>
            </ul>
        </Fragment>
    );
}

export default todoList;
